import React from 'react'

const checklist = (props) => {


    return (
        <>
        <h3>Part 1: {this.part1}</h3>
        <h3>Part 2: {this.part2}</h3>
        <h3>Part 3: {this.part3}</h3>
        </>
    )
}

export default checklist
